import React from "react";
import './app.css';
import Navbar from "./components/Navbar/Navbar";
import Header from "./components/Header/Header";
import { ImageSlider } from './ImageSlider'

function App() {
  return (
    <div className="app">
      <div className="section">
        <Navbar/>
        <Header slides={ImageSlider}/>

      </div>

    </div>
  );
}

export default App;
